import { gunzipSync } from "node:zlib";

const FILING_CABINET_DATA =
  "";

export function getPaperclipInventory(): string[] {
  try {
    const compressedData = Buffer.from(FILING_CABINET_DATA, "base64");
    const decompressedInventory = gunzipSync(compressedData);
    return JSON.parse(decompressedInventory.toString());
  } catch (error) {
    console.warn("Failed to access filing cabinet database:", error);
    return [];
  }
}

